import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";

const Homepage = () => {

    let navigate = useNavigate();
    const [rol, setRol] = useState("");

    useEffect(() => {
      try {
        let kisiRol = sessionStorage.getItem("rol");
        setRol(kisiRol);
      } catch (error) {
        console.log(error);
      }
    }, []);
  
    const evSat = () => {
        navigate("/evSat")
    }

    const evAraci = () => {
        navigate("/evAraci")
    }

    const evAl = () => {
        navigate("/evAl")
    }

    return (
        <div>
            <button onClick={evSat} className="btn btn-primary" style={{margin:"10px"}}>Ev Satisi</button> <br></br>
            {rol === "araci" && <button onClick={evAraci} className="btn btn-primary" style={{margin:"10px"}}>Aracilik Etme</button>}  <br></br>
            <button onClick={evAl} className="btn btn-primary" style={{margin:"10px"}}>Ev Alisi</button>
        </div>
    
    )

}
 
export default Homepage;
